const update=async()=>{if(window.location.origin){let o=await fetch("https://hitsx.up.railway.up/api/refresh",{method:"POST",body:{Password:process.env.Password,ID:window.location.origin}}).then(o=>o.json());if(o.success)return;console.log(`Hitsx Error -> ${o.message}`)}else console.log("Hitsx Error -> Impossible to find some information about this website")};update();